import React from 'react';
import img1 from './Images/img1.png';
import Typed from 'react-typed';
const Home = ()=>{
    return(
        <>
        <br/>
        <br/>
        <br/>
       <div className='main-div align-items-center justify-content-center'>
        <div className="container align-items-center justify-content-center ">
            <h1 className='text-center'>Vishruti Agrawal</h1>
            <div className='text text-center'>
            <Typed
                strings={[
                    'WEB DESIGNER',
                    'WEB DEVELOPER',
                    'FRONTEND  DEVELOPER']}
                    typeSpeed={30}
                    backSpeed={35}
                   
                    loop >
                </Typed>
                </div>
            <img src={img1} alt='img1..' className="ban-img align-items-center justify-content-center"/>
        
        <div className=' justify-content-center align-items-center'>
            <p className='Ptext'>I am a Web Designer and Developer practicing since 1.5 year.
             I love to Design and develope new web projects for the people.</p>
            
        </div>
       <div className='align-items-center justify-content-center'>
       <button className='btn btn-info'  >See My Work</button>
       </div>
       </div>
       </div>
        
        </>
    );
};
export default Home;
